import React from "react";

import mapMakerImg from "../images/map-marker.svg"

function OrphanagesMap() {
    return (
        <div id="page-map">
            <aside>
                <header>
                    <img src={mapMakerImg} alt="Marcador" />
                </header>
            </aside>
        </div>
    )
}

export default OrphanagesMap;
